create table delivery_addresses
(
    id            int unsigned auto_increment comment '配送地址ID'
        primary key,
    user_id       int unsigned                       not null comment '用户ID',
    contact_name  varchar(64)                        not null comment '联系人姓名',
    contact_phone varchar(32)                        not null comment '联系人电话',
    province      varchar(16)                        not null comment '省份',
    city          varchar(16)                        not null comment '市级行政区',
    district      varchar(16)                        not null comment '县级行政区',
    town          varchar(16)                        not null comment '乡镇街道',
    address       text                               not null comment '详细地址（用户填写内容，理论上应不含省市区街道）',
    is_default    tinyint(1)                         not null comment '是否是默认地址',
    created_at    datetime default CURRENT_TIMESTAMP not null,
    updated_at    datetime                           null,
    deleted_at    datetime                           null
)
    collate = utf8mb4_unicode_ci;

create index delivery_addresses_is_default_index
    on delivery_addresses (is_default);

create index delivery_addresses_user_id_index
    on delivery_addresses (user_id);

